import React,{Component}from 'react';
import axios from 'axios';


export default class ArcitectPage extends Component{
    constructor(props){
        super(props);
        this.state={
            id:'',
            username:'',
            email:'',
            Svm:'',
            File:''
        }
    }
    
    componentDidMount(){
        //getRequestByID
        console.log(this.props.id)
        axios.get(`http://localhost:3000/Request/id:${this.state.id}`)
        .then(res=>{ console.log(res)
            // this.setState({
                
            // });
        })
    }

    render(){
        return(
        <div className="row">
            <div className="w-50">
                <ul className="font-weight-light">
                    <li>bla</li>
                    <li>bla</li>
                    <li>bla</li>
                    <li>bla</li>
                </ul>
                <div className="d-flex justify-content-center">
                    <button className="btn btn-success">Accept</button>
                    <button className="btn btn-danger">Decline</button>
                </div>
            </div>
            <div className="w-50 ">
                <ul className="font-weight-light">
                    <li>bla</li>
                </ul>
            </div>
        </div>
        )
    }
}
